syntax = "proto3";

package Platform;

message C2S_Plat_Login
{
    string logintype = 1;
    string t3token = 2;
    string t3userid = 3;
    string t3extra = 4;
    string appCode = 5;
    string bundleid = 6;
    int32  plat = 7;
    string country = 8;
    string lan = 9;
    string channel = 10;
    string subchannel = 11;
}

message S2C_Plat_Login
{
    string logintype = 1;
    string tianlu_token = 2;
    string token_hash = 3;
    int64 expire = 4;
    int32 total_charge = 5;
    int32 cur_plat_coins = 6;
    string servers = 7;
    string zoneids = 8;
}

message C2S_Plat_ServerList
{
    string appCode = 1;
    int32 startid = 2;
    int32 all = 3;
}

message S2C_Plat_ServerList
{
    string zone_infos = 1;
    string server_infos = 2;
}

message C2S_Plat_Charge
{
    string name = 1;
    int32 level = 2;
    int32 items = 3;
}

message S2C_Plat_Charge
{
    string name = 1;
    int32 level = 2;
    int32 items = 3;
}
